import React, { Component } from 'react'
import './LandingPage.css'
import Cards from './Card/Cards/Cards'


class LandingPage extends Component{
    state = {
        
        persons:{name:'Putra', desc:'Coding Membuat Saya Belajar Bagaimana Berpikir',
         title:'Bootcamp Student',image:'data:image/jpeg;base64,'},
        cards:[{span:'HTML Foundation',span2:'Learn HTML Foundation',image:'data:image/jpeg;base64,' },{
            image:'data:image/png;base64,', span:'CSS Foundation', span2:'CSS Foundation lagi'
        }]
    
    }


    render(){
        let cards = this.state.cards.map(card =>{
            return <Cards image={card.image} span={card.span} span1={card.span2}/>
        })
        console.log(this.state.cards)
        return(
            <div className='container'>
            <img src={this.state.persons.image} alt="Gambar" className="img"/> 
            <div className="text"> 
            <h1 className="h1">{this.state.persons.name}</h1>
            <span className="span">{this.state.persons.title}</span>
            <span className="span">{this.state.persons.desc}</span>
            </div>
          
            {cards}
         </div>
        )
    }
}


export default LandingPage;
